import React from "react";
import { Link } from "react-router-dom";

const LogoComponent = () => {
  return (
    <Link to="/">
      <h1 className="logo">
        <span>Projeto Exemplo</span>
      </h1>
    </Link>
  );
};

export default LogoComponent;
